import './App.css';
import { Router, Routes } from 'react-router-dom';
import Login from './components/Login/index';

function App() {
	return (
		<Routes>
			<h1>Hello World!</h1>
			<Router path='/' exact component={Login} />
		</Routes>
	);
}

export default App;
